// HeaderPdf.js
import React from "react";
import { Link } from "react-router-dom";
import "./HeaderPdf.css";

const HeaderPdf = () => {
  return (
    <div className="headerContainer container">
      <div className="row">
        <div className="col-md-6 logoStart">
          <div className="logo">
            <img src={logo} alt="logo" />
          </div>
        </div>
        <div className="col-md-6 buttonEnd">
          <Link to="/pdf-upload" className="btn pdf-button">
            <p>ADD PDF</p>
            <img src={pdflogo} alt="download" />
          </Link>
          {/* Добавьте другие вкладки с ссылками */}
          <Link to="/unloading" className="btn">
            Unloading
          </Link>
          <Link to="/admin" className="btn">
            Admin
          </Link>
        </div>
      </div>
    </div>
  );
};

export default HeaderPdf;
